    true,nt"url": null,nt"notes": "The State Library Agencies Survey, Fiscal
    Year 2002 (StLA FY2002), is a study that is part of the State Library Agencies Survey.
     StLA FY2002 (http://www.imls.gov/research/state_library_agency_survey.aspx) is
    a cross-sectional survey that that provides state and federal policymakers and other
    interested user with information about state library agencies. StLA FY2002 collects
    data on state library agency services to public, academic, and school libraries,
    and library systems, overall this data will help to complete the national picture
    of library service.   The study was conducted using Web survey application via Internet
    Web- based reporting system of 436 items (state library agency identification, governance,
    public service hours. Service outlets, collections, library service transactions,
    library development transactions, services to other libraries in the state, allied
    operations, staff, income, expenditures, and electronic services and information),
    from all 50 states and the District of Columbia.  The response rate for this study
    was 100 percent.",nt"owner_org": "8c0bc869-1189-4ced-af26-2abd2337b886",nt"extras":
